import React from 'react'
import Square from './Square'

const SquaresPage = () => {
  //squares grid:
  let gridArray = [];
  const alphabet = "abcdefghij"
  for(let i =0; i < 10; i++){
    for(let j = 0; j<10;j++){
      gridArray.push(<Square text={i.toString + alphabet.charAt(j)} key={i*10 + j}/>);
    }
  }

  return (
    <div id="itemContainer">
      {gridArray.map(square => square)}
    </div>
  )
}

export default SquaresPage
